import React from 'react';
import { Link } from 'react-router-dom';

export default function Portfolio() {
    return (
        <div>
            <h1>추가하기</h1>
            <button>
                <Link to='/add_portfolio'>추가하기</Link>
            </button>
            <h1>약력</h1>
            <div className='summaryBorder'></div>
        </div>
    );
}
